QID.SOLUTION:
Use cookies instead of the URL to track the session ID. Enforce the renewal of the session ID after any privilege level change, of which the authentication process is the most common case. The web application cannot trust the previous session ID value if it has been fixed by an attacker and must generate a new one when the privilege level of the session changes, e.g. successful authentication. The web application must also invalidate on the server side the value of the previous session ID that has been replaced by the new value. The built in session management frameworks available in some of the most common web application development languages already provide some capabilities to regenerate session IDs and use cookies to track the session ID. The following is the sample code snippet for Java and PHP languages:

Java:
HttpSession sess =request.getSession();
sess.invalidate();
sess = request.getSession(true);

PHP:
session_start();
session_regenerate_id(true);
